import './navListItem.css'
import React from "react"
const NavListItem = ({ nav ,NavOnClick}) => {
  return (
  
      <li>
        <a href={nav.link} className={`${nav.active ? 'active': undefined}`} onClick={()=>{NavOnClick(nav._id)}}>{nav.name}</a>
     </li>
    
  );
}

export default NavListItem;
